import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import reportWebVitals from "./reportWebVitals";

console.log("Le fichier index.js fonctionne !");
console.log("Recherche de l'élément root :", document.getElementById("root")); // Vérification

// Vérifie si le DOM est bien chargé avant d’exécuter React
document.addEventListener("DOMContentLoaded", () => {
  console.log("Le DOM est chargé !");
  console.log("Élément root après DOMContentLoaded :", document.getElementById("root")); // Vérification

  const rootElement = document.getElementById("root");

  if (rootElement) {
    const root = ReactDOM.createRoot(rootElement);
    root.render(
      <React.StrictMode>
        <App />
      </React.StrictMode>
    );
    console.log("React a bien démarré !");
  } else {
    console.error("Erreur : Impossible de trouver l'élément root !");
  }
});

reportWebVitals();
